import React, { useState } from 'react';
import axios from 'axios';

function Post() {
    const [apidata,setApidata]=useState([])
    axios
      .apidata("https://jsonplaceholder.typicode.com/photos", {
        title: "Hello World!",
        body: "This is a new post."
      })
      .then((response) => {
        setApidata(response.data);
        console.log
      });
  }

  export default Post;
